import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Img from "react-image";
import SEO from "react-seo-component";

// Layout
import Layout from "../components/Layout";
import ListeningLayout from "../listening-components/ListeningLayout";

function Listening({ statusCode }) {
  return (
    <Layout>
      <Container>
        <SEO
          title="Listening Exercises | CXC Spanish Online"
          description={
            "Practice listening with recordings of conversations with native Spanish speaker for your CXC Spanish exam."
          }
          pathname={"https://www.cxcspanish.com/listening"}
          siteLanguage={"en"}
          siteLocale={""}
          twitterUsername={"_rxheem"}
        />

        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Listening Exercises</BreadcrumbItem>
        </Breadcrumb>

        <ListeningLayout>
          <Card>
            <CardBody>
              <CardTitle>Listening Exercises</CardTitle>

              <br />
              <p>Lorem ipsum dolor sit amet.</p>

              <ul style={{ paddingLeft: "-25px" }}>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
              </ul>
              <Button>Read more &rarr;</Button>
            </CardBody>
          </Card>
        </ListeningLayout>
      </Container>
    </Layout>
  );
}

Error.getInitialProps = ({ res, err }) => {
  const statusCode = res ? res.statusCode : err ? err.statusCode : 404;
  return { statusCode };
};

export default Listening;
